        function updateNavigationVisibility() {
          const nav = document.querySelector('.fixed.right-8 nav.space-y-2');
          const dots = document.querySelector('.fixed.right-8 .group nav');
          if (!nav || !dots) return;

          const navRect = nav.getBoundingClientRect();
          const viewportWidth = window.innerWidth;
          const rightMargin = 32; // right-8 = 2rem = 32px
          const availableSpace = viewportWidth - navRect.right - rightMargin;

          // Get all navigation items
          const navItems = dots.querySelectorAll('.group/item');
          
          if (availableSpace < 200) { // Minimum space needed for expanded navigation
            nav.classList.add('hidden');
            dots.classList.remove('hidden');
            // Collapse all items
            navItems.forEach(item => {
              const button = item.querySelector('button');
              if (button) {
                button.style.width = '0.5rem';
                button.classList.remove('group-hover:w-full');
              }
            });
          } else {
            nav.classList.remove('hidden');
            dots.classList.add('hidden');
            // Expand all items
            navItems.forEach(item => {
              const button = item.querySelector('button');
              if (button) {
                button.style.width = '100%';
                button.classList.add('group-hover:w-full');
              }
            });
          }
        }

        // Initial check
        updateNavigationVisibility();

        // Update on resize and scroll
        window.addEventListener('resize', updateNavigationVisibility);
        window.addEventListener('scroll', updateNavigationVisibility);
